-- === CONFIGURACIÓN DE RUTA EXTERNA ===
local FOLDER_NAME = "Moon_Seek"
local FILE_PREFIX = "MoonSeek"

-- Intentamos crear la carpeta en la raíz
pcall(function()
    if not isfolder(FOLDER_NAME) then
        makefolder(FOLDER_NAME)
    end
end)

-- Buscar el número de archivo disponible
local fileIndex = 1
local fileName = FOLDER_NAME .. "/" .. FILE_PREFIX .. fileIndex .. ".txt"

while isfile(fileName) do
    fileIndex = fileIndex + 1
    fileName = FOLDER_NAME .. "/" .. FILE_PREFIX .. fileIndex .. ".txt"
end

-- Función de guardado silencioso
local function saveToLog(data)
    local success, err = pcall(function()
        appendfile(fileName, os.date("[%H:%M:%S] ") .. tostring(data) .. "\n")
    end)
    if not success then
        -- Si falla la carpeta externa, intentamos en el workspace por si acaso
        appendfile(FILE_PREFIX .. "_FALLBACK.txt", "ERROR RUTA: " .. tostring(err) .. " | DATA: " .. tostring(data) .. "\n")
    end
end

saveToLog("=== INFILTRACIÓN INICIADA (RAÍZ DELTA) ===")

-- === HOOKS DE INTERCEPCIÓN ===

-- Espiamos la carga de código
local old_load = loadstring
loadstring = function(source, chunk)
    saveToLog("[LOADSTRING] Código detectado:\n" .. source)
    return old_load(source, chunk)
end

-- Espiamos la comunicación con el juego
local old_gs = game.GetService
game.GetService = function(self, service)
    saveToLog("[SERVICE] Solicitado: " .. tostring(service))
    return old_gs(self, service)
end

-- Espiamos lo que el script intenta imprimir (aquí suele soltar datos clave)
local old_print = print
print = function(...)
    local out = ""
    for i, v in ipairs({...}) do out = out .. tostring(v) .. " " end
    saveToLog("[LOG] " .. out)
    -- Opcional: descomenta la línea de abajo si quieres verlo también en consola
    -- return old_print(...) 
end

-- Bloqueamos intentos de Kick para que no te saquen mientras grabas
local lp = game:GetService("Players").LocalPlayer
local old_kick
old_kick = hookfunction(lp.Kick, function(self, reason)
    saveToLog("[KICK BLOQUEADO] Razón: " .. tostring(reason))
    return
end)

saveToLog("=== ESPÍA ACTIVO - ESPERANDO VM DE WEAREDEVS ===")

